Wikipedia: &quot;Juan de Flandes (&quot;John of Flanders&quot;; c. 1460 – by 1519) was a Flemish painter active in Spain from 1496 to 1519.&quot;

Wikipedia: &quot;Joanna (6 November 1479 – 12 April 1555), historically known as Joanna the Mad (Spanish: Juana la Loca), was the nominal queen of Castile from 1504 and queen of Aragon from 1516 to her death in 1555. She was the daughter of Queen Isabella I of Castile and King Ferdinand II of Aragon. Joanna was married by arrangement to the Austrian archduke Philip the Handsome on 20 October 1496&quot;

Wikipedia:  &quot;Philip the Handsome (22 July 1478 – 25 September 1506), also called the Fair, was ruler of the Burgundian Netherlands and titular Duke of Burgundy from 1482 to 1506, as well as the first Habsburg King of Castile (as Philip I) for a brief time in 1506.

The son of Maximilian of Austria (later Holy Roman Emperor as Maximilian I) and Mary of Burgundy, Philip was not yet four years old when his mother died as a result of a riding accident, and upon her death, he inherited the Burgundian Netherlands. Despite his young age, Philip quickly proved himself an effective ruler beloved by his people in the Low Countries, pursuing policies that favored peace and economic development, while maintaining a steady course of the government building.&quot;

