{'_content': 'Canon EOS R6 Mark II, Canon EF 24-105mm f/4L IS USM, processed in Lightroom and Photoshop. 

The Anker clock is an outstanding work of the Jugendstil, and was completed in 1915.

Wikipedia: &quot;Die Ankeruhr ist eine große Spieluhr beim Haus der Helvetia-Versicherung (vormals Lebens- und Rentenversicherungs-Gesellschaft „Der Anker“) am Hohen Markt 10–11 in der Altstadt Wiens. Die Ankeruhr gilt als eines der herausragenden Werke des Jugendstils und ist eine beliebte Touristenattraktion.

Die Ankeruhr ist eine brückenartige Verbindung zwischen den beiden Gebäudeteilen des Ankerhofes, sie überspannt das Gässchen Bauernmarkt. Diese „Uhrbrücke“ hat eine Spannweite von zehn Metern und eine Höhe von 7,5 Metern; die Uhr selbst hat einen Durchmesser von vier Metern. Getragen wird die Brücke von vier figuralen Konsolen, an denen vorne Adam und Eva und hinten Engel und Teufel dargestellt sind. Über der Uhr befindet sich eine Sonnenscheibe, flankiert von einem Kind mit Schmetterling als Allegorie für das Leben, und einer Sanduhr als Symbol für den Tod – eine für eine Versicherungsgesellschaft bedeutsame Symbolik. Bei Dunkelheit wird die Uhr von Scheinwerfern beleuchtet.&quot;

<a href="https://de.wikipedia.org/wiki/Ankeruhr" rel="noreferrer nofollow">de.wikipedia.org/wiki/Ankeruhr</a>
<a href="https://www.geschichtewiki.wien.gv.at/Ankeruhr" rel="noreferrer nofollow">www.geschichtewiki.wien.gv.at/Ankeruhr</a>'}

{'_content': 'Canon EOS R6 Mark II, Canon EF 24-105mm f/4L IS USM, processed in Lightroom. 

This programme started in 1956; on our visit to Wien in 1968, the booklet and the signs with four flags guided us through the city, giving us much insight and enjoyment, opening a new world for us. Of course, the 'big' places like this one have them, but of more value are the many signs indicating places of which one would otherwise remain ignorant. Things change, more signs have been set up, others replaced, some have fallen by the wayside. Now the new signs are bilingual, and the programme has a new name. The booklet, it seems, is no more - a great pity. Still, there are online details . . .

<a href="https://cityabc.at/index.php/Kategorie:Eine_Stadt_stellt_sich_vor" rel="noreferrer nofollow">cityabc.at/index.php/Kategorie:Eine_Stadt_stellt_sich_vor</a>'}

