{'_content': 'Japanese Items in Weltmuseum Wien -- some showing clear Art Nouveau / Jugendstil influences

Items Archduke Franz Ferdinand of Austria bought in Singapore in April 1893 during his world tour.

The <a href="https://www.european-traveler.com/austria/visit-the-weltmuseum-wien-world-museum-of-ethnology-in-vienna/" rel="noreferrer nofollow">Weltmuseum Wien</a> (World Museum Vienna) has one of the largest ethnological collections in Europe. The best-known items here are the only surviving Aztec feather headdress (<a href="https://www.european-traveler.com/austria/see-moctezumas-feather-headdress-from-mexico-in-the-weltmuseum-vienna/" rel="noreferrer nofollow">Penacho de Moctezuma</a>) from pre-Columbian Mexico and a large collection of Benin Bronzes.  '}

{'_content': 'Commemorative heads of kings and carved ivory reliefs, Benin Bronzes, center from left: 16th, 17/18th, and 19th century.

The <a href="https://www.european-traveler.com/austria/visit-the-weltmuseum-wien-world-museum-of-ethnology-in-vienna/" rel="noreferrer nofollow">Weltmuseum Wien</a> has with just over 200 items, the seventh-largest collection of Benin bronzes in the world. These were looted from Benin in 1897 with the items in Vienna purchased from the British Museum in London, which had to sell some works to finance the expedition retrospectively.

The <a href="https://www.european-traveler.com/austria/visit-the-weltmuseum-wien-world-museum-of-ethnology-in-vienna/" rel="noreferrer nofollow">Weltmuseum Wien</a> (World Museum Vienna) has one of the largest ethnological collections in Europe. The best-known items here are the only surviving Aztec feather headdress (<a href="https://www.european-traveler.com/austria/see-moctezumas-feather-headdress-from-mexico-in-the-weltmuseum-vienna/" rel="noreferrer nofollow">Penacho de Moctezuma</a>) from pre-Columbian Mexico and a large collection of Benin Bronzes.  '}

