{'_content': "Wenen heeft als sterk sociaal-democratisch georiënteerde stad al meer dan een eeuw een stevig beleid inzake volkshuisvesting. De gemeente is de grootste huisbaas, daarnaast zijn er ook particuliere woningcorporaties. Dit woongebouw in de wijk Erdberg is een voorbeeld uit de jaren '20 van de vorige eeuw. De 'gemeenteblokken' zijn makkelijk herkenbaar aan hun rode teksten op de gevel.

De beschikbaarheid en betaalbaarheid van woningen steekt gunstig af bij Nederland, waar de volkshuisvesting is ontspoord bij de invoering van neoliberale doctrines. Nederlandse bestuurders van grote steden gaan nu wel eens in Wenen kijken hoe ze het daar toch aanpakken

<i>Vienna, as a social-democratic oriented city over the years, has a strong public housing policy. Since more than a century, many residential buildings were built by the municipality. This is an example from the 1920s in Erdberg district</i>"}

