{'_content': 'Vienna at night: Karlskirche

🇬🇧 In 1713, during the last great plague epidemic, Charles VI, Holy Roman Emperor, pledged to build a church for his namesake patron saint, Charles Borromeo, who is revered as a healer for plague sufferers. The plague ended one year later and the Emperor startet the project to fulfill his pledge. Today the Karlskirche is considered the most outstanding baroque builing in Vienna.

🇩🇪 Während der letzten großen Pestepidemie 1713 gelobte Kaiser Karl VI. eine Kirche bauen zu lassen, um durch dieses kaiserliche Versprechen die Seuche zu beenden. Ein Jahr später war die Pest erloschen, und Kaiser Karl IV lies diese barocke Kirche errichten und widmete sie dem Pestheiligen Karl Borromäus.'}

